import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AuthGuard } from './auth.guard';

const routes: Routes = [
  { path: '', redirectTo: '/', pathMatch: 'full' },
  { path: 'login', loadChildren: () => import('./components/login/login.module').then(m => m.LoginModule) },
  { path: 'register', loadChildren: () => import('./components/register/register.module').then(m => m.RegisterModule) },
  { path: 'forget-password', loadChildren: () => import('./components/forget-password/forget-password.module').then(m => m.ForgetPasswordModule) },
  { 
    path: 'dashboard', 
    loadChildren: () => import('./components/dashboard/dashboard.module').then(m => m.DashboardModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'user-list', 
    loadChildren: () => import('./components/user-list/user-list.module').then(m => m.UserListModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'user-create', 
    loadChildren: () => import('./components/user-create/user-create.module').then(m => m.UserCreateModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'user-edit/:id', 
    loadChildren: () => import('./components/user-edit/user-edit.module').then(m => m.UserEditModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'user-view/:id', 
    loadChildren: () => import('./components/user-view/user-view.module').then(m => m.UserViewModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'profile', 
    loadChildren: () => import('./components/profile/profile.module').then(m => m.ProfileModule),
    canActivate: [AuthGuard]
  },
  { 
    path: 'change-password', 
    loadChildren: () => import('./components/change-password/change-password.module').then(m => m.ChangePasswordModule),
    canActivate: [AuthGuard]
  },
  { path: '**', redirectTo: '/' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
